import React, { useState } from 'react';
import { useNavigate, useParams } from "react-router-dom";

function FeeRegister() {
  const navigate = useNavigate();
const { applicationId } = useParams();  
const [formData, setFormData] = useState({
    INSTITUTE: '',
    STUDENTID: applicationId,
    SESSION: '',
    CLASS: '',
    JUNE: '',
    JULY: '',
    AUGUST: '',
    SEPTEMBER: '',
    OCTOBER: '',
    NOVEMBER: '',
    DECEMBER: '',
    JANUARY: '',
    FEBRUARY: '',
    MARCH: '',
    LATEFEEPERDAY:'',
    LATEFEEAPPLICABLE: '',
    CUTOFFDAY: '',
    CHATID: '',
    R_FEE:'',
    REMARK:'',
    S_FEE:'',
    B_FEE:'',
    U_FEE:'',
    R_DATE:'',
    A_DATE:'',
  });



  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };



  const handleSubmit = (e) => {
    e.preventDefault();

    // Convert form data to JSON
    const jsonData = JSON.stringify(formData);

    console.log(formData);

    // Send JSON data to backend
    fetch('http://49.206.252.212:5000/fee-register', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: jsonData
    })
    .then(response => {
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      return response.json();
    })
    .then(data => {
      console.log('Success:', data);
      if (data.success) {
        alert('Data entered successfully');
        navigate('/register')
      } else {
        alert(data.message);
      }
    })
    .catch(error => {
      console.error('Error:', error);
      // Optionally, you can handle errors here
    });
  };

  return (
    <div className="form-container max-w-lg mx-auto p-6 bg-white rounded shadow-lg">
    <h2 className="form-header text-2xl font-semibold mb-4 flex justify-center">Fee registration</h2>
    <form className="grid grid-cols-2 gap-4" onSubmit={handleSubmit}>
      {/* Student Details */}
      <div className="col-span-2 md:col-span-1">
        <h2 className="text-xl font-bold mb-4">Student Details</h2>
        <div className="grid grid-cols-1 gap-4">
          {/* Student detail inputs */}
        </div>
      </div>

      {/* Month wise */}
      <div className="col-span-2 md:col-span-1">
        <h2 className="text-xl font-bold mb-4">Month wise</h2>
        <div className="grid grid-cols-1 gap-4">
          {/* Month wise inputs */}
        </div>
      </div>

      {/* Submit Button */}
      <div className="col-span-2 flex justify-center mt-6">
        <button type="submit" className="form-button bg-indigo-600 hover:bg-indigo-700 text-white font-bold py-2 px-12 rounded">Submit</button>
      </div>
    </form>
  </div>


  );
}

export default FeeRegister;
